import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Find and click on the first product card to open the details modal.
    const firstProductCard = page.locator('.product-card').first();
    await firstProductCard.waitFor({ state: 'visible', timeout: 5000 });
    await firstProductCard.click();

    // 2. Wait for the product detail modal to become visible.
    await page.waitForSelector('#productModal', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal_visible.png'));

    // 3. Find and click the "Add to Wish List" button using a user-facing role selector.
    const addToWishlistButton = page.getByRole('button', { name: 'Add to Wish List' });
    await addToWishlistButton.waitFor({ state: 'visible', timeout: 5000 });
    await addToWishlistButton.click();

    // 4. Wait for the success notification to confirm the action and extract its text.
    const notification = page.locator('.notification.success');
    await notification.waitFor({ state: 'visible', timeout: 5000 });

    const notificationText = await notification.textContent();

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_wishlist_confirmation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_wishlist_confirmation.png'));

    return {
      success: true,
      action: "Added a product to the wishlist and verified the confirmation message.",
      extractedData: {
        confirmationMessage: notificationText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
